import React, { useState, useEffect } from 'react';
import axios from 'axios';
 
const ReservationList = () => {
    const [reservations, setReservations] = useState([]);
 
    useEffect(() => {
        fetchReservations();
    }, []);
 
    const fetchReservations = async () => {
        const response = await axios.get('/reservations/getAllReservations');
        setReservations(response.data);
    };
 
    const deleteReservation = async (id) => {
        await axios.delete(`/reservations/deleteReservation/${id}`);
        fetchReservations();
    };
 
    const formatDate = (dateString) => {
        const date = new Date(dateString);
        const options = { year: 'numeric', month: 'long', day: 'numeric' };
        return date.toLocaleDateString(undefined, options);
    };
 
    const formatTime = (timeString) => {
        const time = new Date(`1970-01-01T${timeString}`);
        const hours = time.getHours();
        const minutes = time.getMinutes();
        const ampm = hours >= 12 ? 'PM' : 'AM';
        const formattedHours = hours % 12 || 12;
        const formattedMinutes = minutes < 10 ? `0${minutes}` : minutes;
        return `${formattedHours}:${formattedMinutes} ${ampm}`;
    };
 
    return (
<div>
<div className="reservation-list-container">
<h2>Current Bookings</h2>
<ul>
                    {reservations.map(reservation => (
<li key={reservation.reservationId}>
<p><strong>Reservation Date:</strong> {formatDate(reservation.reservationDate)}</p>
<p><strong>Time In:</strong> {formatTime(reservation.startTime)}</p>
<button onClick={() => deleteReservation(reservation.reservationId)} className="delete-button">
                                Delete Reservation
</button>
</li>
                    ))}
</ul>
</div>
 
            <footer className="footer">
<div className="footer-section">
<h3>TeknoLib</h3>
<p>Contact us</p>
<p>TeknoLib@gmail.com</p>
<p>+1-2345-6789</p>
<p>Cebu Institute of Technology University</p>
</div>
 
                <div className="footer-section">
<h3>Products</h3>
<p>Auctor volutpat</p>
<p>Fermentum turpis</p>
<p>Mi consequat</p>
<p>Convallis porttitor</p>
</div>
 
                <div className="footer-section">
<h3>About</h3>
<p>Cajegas, Angelo</p>
<p>Tesaluna, Josh</p>
<p>Basalo, Michael</p>
<p>Paquero, Ronan</p>
<p>Cagampang, Emmanuel</p>
</div>
<div className="footer-bottom">
<p>© 2020. All rights reserved.</p>
</div>
</footer>
 
            <style>{`
                .reservation-list-container {
                  background-color: rgba(255, 255, 255, 0.9);
                  padding: 30px;
                  border-radius: 10px;
                  width: 40%;
                  margin: auto;
                  text-align: center;
                }
 
                h2 {
                  color: #333;
                  margin-bottom: 20px;
                }
 
                ul {
                  list-style: none;
                  padding: 0;
                }
 
                li {
                  margin-bottom: 15px;
                  border-bottom: 1px solid #ddd;
                  padding-bottom: 10px;
                }
 
                .delete-button {
                  background-color: #e63946;
                  color: #fff;
                  border: none;
                  padding: 5px 10px;
                  cursor: pointer;
                  border-radius: 5px;
                }
 
                .footer {
                  display: flex;
                  justify-content: space-around;
                  background-color: #ffb703;
                  padding: 40px 20px;
                  color: #fff;
                }
 
                .footer-section {
                  display: flex;
                  flex-direction: column;
                  gap: 5px;
                }
 
                .footer-section h3 {
                  font-size: 1.2em;
                  margin-bottom: 10px;
                  color: #fff;
                }
 
                .footer-section p {
                  color: #fff;
                }
 
                .footer-bottom {
                  text-align: center;
                  margin-top: 20px;
                  color: #fff;
                  font-size: 0.9em;
                }
 
                .footer-bottom p {
                  margin: 0;
                }
            `}</style>
</div>
    );
};
 
export default ReservationList;
